import { CardComponent } from "./CardComponent"
import tataimage from "../images/Final logo - Tata motors .png"
import berrysimage from "../images/Berrys.png"
const cardsData=[{
    imageBuyer:tataimage,
    buyer: "TATA",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"100000",
    xirr:"15.29%",
    tenure:"60"

}]
export const Dashboardpage=()=>{
    return <div className="bg-gray-50 h-screen px-64 py-16 grid grid-cols-3 gap-4">
        {cardsData.map((card,index) => (
        <CardComponent
        key={index}
          imageBuyer={card.imageBuyer}
          buyer={card.buyer}
          seller={card.seller}
          imageSeller={card.imageSeller}
          unitcost={card.unitcost}
          xirr={card.xirr}
          tenure={card.tenure}

        />
      ))}
     
       
    </div>
}
